import React from "react";
import "../styServices.css";

const services = [
  { title: "Web Development", icon: "💻" },
  { title: "UI/UX Design", icon: "✏️" },
  { title: "Graphic Design", icon: "🎨" },
  { title: "SEO", icon: "📈" },
  { title: "Video Editing", icon: "🎬" },
  { title: "Photography", icon: "📷" },
];

const Services = () => {
  return (
    <section className="services-section">
      <div className="services-header">
        <h2>My Services</h2>
      </div>
      <div className="services-grid">
        {services.map((service, index) => (
          <div key={index} className="service-card">
            <div className="service-icon">{service.icon}</div>
            <h3 className="service-title">{service.title}</h3>
            <p className="service-description">
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Consequuntur rem, aperiam alias quis
              sequi architecto.
            </p>
            <div className="service-arrow">↘</div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Services;
